import './App.css';
import Axios from 'axios';
import { useState } from "react";

function App() {
  const [query, setQuery] = useState([]);

  const getEmployees = () => {
    console.log("clicked");
    Axios.get("http://localhost:3001/employees").then((response) => {
      const newQuery = response.data;
      setQuery(newQuery);
    })

    query.map((val, key) => {
      return (
        <div> {
          [val].map((val2, key2) => { 
              console.log(val2 + key2) 
          })
        }

        {console.log(val) }
        </div>
      )
    })
  }

  return (
    <div className="App">
      <h1>Hello world</h1>
      <button onClick={getEmployees}>Get Employee</button>
    </div>
  );
}

export default App;
